export default class Home extends Component {
  render() {
    return (
      <div>
        <HomeStyle bgImg={bgImg} bgLogo={bgLogo}>
          <div className="box">
            <div className="bgImg"></div>
            <div className="bgLogo"></div>
            <div className="title">
              <p>the</p>
              <p>avengers</p>
              <div className="line">{/* <Line width="60%" /> */}</div>
            </div>
          </div>
        </HomeStyle>
      </div>
    );
  }
}
